import React,{Component} from "react";

class Person2 extends Component {
    constructor(props){
        super(props);
        this.props=props;
    }
    render(){
        return(
            <>
                <div>{this.props.name}</div>
                <div>{this.props.age}</div>
            </>
        );
    }
}
export default Person2;
